Juntados
      1 - Tramitação da matéria na Comissão Mista (fls. 238 a 243, cópias das páginas correspondentes no portal do Congresso Nacional);
      2 - Composição atual da Comissão Mista (fls. 244 e 245, cópias da Ordem do Dia do Congresso Nacional); e 
      3 - Os seguintes ofícios de substituição de membros da Comissão (fls. 246 a 272):

      - nº 45, de 2019, do DEM-CD;
      - nº 100, de 2019, do DEM-CD;
      - nº 43, de 2019, do PSDB-SF;
      - nº 107, de 2019, do DEM-CD;
      - nº 111, de 2019, do DEM-CD;
      - nº 114, de 2019, do DEM-CD;
      - nº 137, de 2019, do DEM-CD;
      - nº 13, de 2019, do Bloco Vanguarda- SF;
      - n° 40, de 2019, do PSD-SF;
      - nº 36, de 2019, do Bloco Senado Independente - SF;
      - nº 140, de 2019, do DEM-CD;
      - nº 141, de 2019, do DEM-CD;
      - nº 31, de 2019, do MDB-SF;
      - nº 31, de 2019, do PP-SF;
      - nº 24, de 2019, do PSL-SF;
      - nº 74, de 2019, do Bloco PDT, SD, PODE, PCdoB, PROS, AVANTE, PV, DC - CD;
      - nº 166, de 2019, do DEM-CD;
      - nº 174, de 2019, do DEM-CD;
      - n° 115, de 2019, do PT - CD;
      - nº 116, de 2019, do Bloco PDT, SD, PODE, PCdoB, PROS, AVANTE, PV, DC - CD;
      - n° 70, de 2019, do PRB-CD;
      - n° 30, de 2019, do Bloco Parlamentar da Resistência Democrática - SF;
      - n° 58, de 2019, do PR-CD;
      - nº 19, de 2019, do PSL-SF;
      - n° 122, de 2019, do PSB-CD; e
      - n° 261, de 2019, do PT – CD.

Designada, em 15 de fevereiro de 2019, a Comissão Mista incumbida de emitir parecer sobre a matéria (fls. 79 a 91).
      Anexados os seguintes Ofícios de indicação de liderança:
      - Ofício nº 8/2019, da Liderança do PR-CD; 
      - Ofícios nºs 1 e 59, de 2019, da Liderança do Bloco PSL/PP/PSD/MDB/PRB/DEM/PSDB/PTB/PSC/PMN-CD; 
      - Ofício nº 3, de 2019, do Bloco PODEMOS/PSDB/PSL-SF; 
      - Ofício nº 16/2019, da Liderança do PSB-CD.

      A composição da Comissão Mista e o calendário de tramitação da matéria estão publicados na Ordem do Dia do Congresso Nacional e serão publicados no Diário do Congresso Nacional de 21 de fevereiro de 2019.
      Será feita a comunicação à Câmara dos Deputados (§7º do art. 2º da Resolução nº 1 de 2002-CN).
      Matéria remetida à Coordenação de Comissões Mistas.

Publicado no DOU de 27/12/2018, na página 16, a Medida Provisória 867/2018.
      Calendário da Medida Provisória: 
      - Designação da comissão: ;
      - Emendas: 11/02/2019;
      - Prazo na comissão:  *;
      - Regime de urgência, obstruindo a pauta a partir de: 21/03/2019 (46° dia);
      - Prazo final no Congresso: 04/04/2019 (60 dias).
      * A Comissão Mista deve, obrigatoriamente, emitir parecer antes de a matéria ser submetida aos Plenários da Câmara dos Deputados e do Senado Federal (art. 62, § 9º - CF / Ação Direta de Inconstitucionalidade nº 4.029 - DOU de 16/03/2012)
